// SPDX-License-Identifier: Unlicense
pragma solidity 0.8.17;

contract Whitelist {
    
    //Максимально допустимое значение в вайтлист
    uint8 public maxWhitelistedAddresses;

    //Создаём маппинг с вайтлист адресами
    //если адресс в вайтлисте, то тру, иначе false по умолч

    mapping (address => bool) public whitelistedAddresses;

    //данная переменая помогает отслеживать кол-во адрессов в вайтлисте
    //название не меняем, так как это часть верифа

    uint8 public numAddressesWhitelisted;

    //установка максимального количества адресов в белом списке
    //пользователь поместит значение во время развертывания

    constructor (uint8 _maxWhitelistedAddresses) {
        maxWhitelistedAddresses = _maxWhitelistedAddresses;
    }

    //след. функция добавляет адрес отправителя транзы в вайтлист

    function addAddressToWhitelist () public {
        require(!whitelistedAddresses[msg.sender], "Sender has already been whitelisted");
        require(numAddressesWhitelisted < maxWhitelistedAddresses, "More addresses can't be added, limit reached");
        //добавляем адрес в массив или маппинг
        whitelistedAddresses[msg.sender] = true;
        numAddressesWhitelisted +=1;
    }
}

